import { todoCount, subscribeRpt } from "../../../api/dashboard/dashboard";
import CountTo from 'vue-count-to';
export default {
  components: {
    CountTo: CountTo
  },
  data: function data() {
    return {
      activeName: 'second',
      count: {
        todo: 0,
        newIp: 0,
        newVisits: 0,
        recentIp: 0,
        recentVisits: 0
      },
      subscribe: {
        title: '我的订阅',
        total: 0
      }
    };
  },
  mounted: function mounted() {
    var _this = this;

    console.log("dcc================");
    todoCount().then(function (res) {
      _this.count.todo = res.data;
    });
    subscribeRpt().then(function (res) {
      console.log("dasdasdas==>" + res.toString());
      _this.subscribe.total = res.data.total;
    });
  },
  methods: {
    openTodoList: function openTodoList() {
      this.$router.push({
        path: '/todo/list'
      });
    },
    openFavorite: function openFavorite() {
      this.$router.push({
        path: '/favorite/index'
      });
    },
    openReport: function openReport() {
      this.$router.push({
        path: '/report/index'
      });
    },
    openIndex: function openIndex() {
      this.$router.push({
        path: '/indicators/query'
      });
    },
    openSubscribeList: function openSubscribeList() {
      this.$router.push({
        path: '/indicator/resultSubscribe'
      });
    }
  }
};
